// Standard Libraries
import React from 'react'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

// Styling
import "./App.css";

// Pages
import { ViewGamePage } from "./front_end/src/pages/ViewGamePage";
import { AddGamePage } from "./front_end/src/pages/AddGamePage";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component = {HomePage} />
        <Route exact path="/add_game" component={AddGamePage} />
        <Route exact path="/view_game:game" component={ViewGamePage} />
      </Switch>
    </Router>
  );
}

export default App;
